import React from "react";
import { Container, Row, Col } from "reactstrap";

import slider from '../assets/images/slider.jpg'
const home = () => {
  return (
    <>
      <section>
        <Container>
          <Row className="w-100">
            <img src={slider} alt="" />
          </Row>
        </Container>
      </section>
    </>
  )
}

export default home
